INSERT INTO `internship` (`id`, `title`, `desc`, `image`, `content`, `date_created`, `slug`) VALUES
(1, 'Internship Standard Operating Procedure', 'Internship Standard Operating Procedure at Red Level', 'f3d869107f746beb5a2c3608675b0702.jpeg', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal;mso-outline-level:2\"><b><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:in\"=\"\">1. Purpose of the Guide</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-fareast-language:in\"=\"\">Panduan ini berisi definisi prakerin, konsep prakerin,\r\ntujuan rakerin, peran, peraturan, konsekuensi, agenda dan syarat seorang\r\npeserta prakerin dinyatakan telah lulus prakerin. Pedoman ini wajib dipahami\r\noleh peserta prakerin maupun yang berencana mendaftar prakerin, agar bisa\r\nberadaptasi dengan baik, menghindari kesalahpahaman dan mendapatkan hasil prakerin\r\nyang maksimal. </span></p><span style=\"font-weight: normal;\"><span style=\"font-size:12.0pt\"></span></span><h2 style=\"text-align:justify\"><span style=\"font-weight: normal;\"><span style=\"font-size:12.0pt\"><b style=\"mso-bidi-font-weight:normal\">2. Definition of Internship<br></b></span></span></h2>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\">Menurut Undang-Undang Nomor 13 Tahun\r\n2003 tentang Ketenagakerjaan, Pemagangan adalah bagian dari <span style=\"font-family:\" calibri\",\"sans-serif\";mso-ascii-theme-font:minor-latin;=\"\" mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"times=\"\" new=\"\" roman\";=\"\" mso-bidi-theme-font:minor-bidi\"=\"\">sistem pelatihan kerja</span> yang\r\ndiselenggarakan secara terpadu antara pelatihan di lembaga pelatihan dengan\r\nbekerja <span style=\"font-family:\" calibri\",\"sans-serif\";mso-ascii-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"times=\"\" new=\"\" roman\";=\"\" mso-bidi-theme-font:minor-bidi\"=\"\">secara langsung di bawah bimbingan dan\r\npengawasan instruktur atau pekerja/buruh yang lebih berpengalaman</span>,\r\ndalam proses produksi barang dan/atau jasa di perusahaan, <span style=\"font-family:\" calibri\",\"sans-serif\";mso-ascii-theme-font:minor-latin;=\"\" mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"times=\"\" new=\"\" roman\";=\"\" mso-bidi-theme-font:minor-bidi\"=\"\">dalam rangka menguasai keterampilan atau\r\nkeahlian tertentu</span>. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Prakerin (Praktik Kerja Industri) adalah\r\nkegiatan pendidikan, pelatihan dan pembelajaran yang dilaksanakan di dunia\r\nusaha atau dunia industri yang relevan dengan kompetensi (kemampuan) siswa\r\nsesuai bidangnya.</span><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\";mso-fareast-language:in\"=\"\"></span></p>\r\n\r\n<p style=\"text-align:justify\">Dalam sistem ini, prakerin dilakukan dengan\r\nkonsep pendidikan, yang mana terdapat proses pengubahan sikap\r\ndan perilaku peserta sebagai usaha mendewasakan peserta prakerin dalam hal\r\ndunia pekerjaan, yang mana disebut dengan istilah <strong>PROFESIONAL</strong>.</p><b style=\"mso-bidi-font-weight:normal\">3. GOAL</b>\r\n\r\n<p style=\"text-align:justify\">Target dari sistem prakerin Red Levl Mediatama\r\nadalah:</p>\r\n\r\n<p class=\"image-container\" style=\"text-align:justify\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:20.0pt\">Membantu Peserta menjadi Talent\r\nProfesional</span></b></p>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Definisi Membantu</span></h2>\r\n\r\n<p style=\"text-align:justify\">Red Levl hanya berperan untuk membantu dengan\r\nmemberi arahan, bimbingan, mentor, dan lain sebagainya. Namun, kunci\r\nkeberhasilan untuk mencapai level profesional <strong>TERGANTUNG PADA INDIVIDU\r\nMASING-MASING</strong>.</p>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Definisi\r\nProfesional</span></h2>1. Cerdas<br><br>Meliputi namun tidak terbatas:<br><br>&nbsp;&nbsp;&nbsp;  Inisiatif<br>&nbsp;&nbsp;&nbsp;  Kreatif<br>&nbsp;&nbsp;&nbsp;  Mampu menganalisa masalah dengan tepat<br>&nbsp;&nbsp;&nbsp;  Open mind<br>&nbsp;&nbsp;&nbsp;  Peka terhadap masalah<br>&nbsp;&nbsp;&nbsp;  Perencanaan yang baik<br>&nbsp;&nbsp;&nbsp;  Problem Solving yang baik<br><br>2. Jujur<br><br>Meliputi namun tidak terbatas:<br><br>&nbsp;&nbsp;&nbsp;  Detail<br>&nbsp;&nbsp;&nbsp;  Fokus pada kebenaran dan kenyataan<br>&nbsp;&nbsp;&nbsp;  Kesesuaian antara ucapan, catatan dan perbuatan<br>&nbsp;&nbsp;&nbsp;  Tegas<br>&nbsp;&nbsp;&nbsp;  Menghindari asumsi<br>&nbsp;&nbsp;&nbsp;  Transparan<br><br>3. Komunikatif<br><br>Meliputi namun tidak terbatas:<br><br>&nbsp;&nbsp;&nbsp;  Berpikir dan bersikap positif<br>&nbsp;&nbsp;&nbsp;  Mampu berkomunikasi dengan client<br>&nbsp;&nbsp;&nbsp;  Mampu membuat dokumentasi yang baik<br>&nbsp;&nbsp;&nbsp;  Pendengar yang baik<br>&nbsp;&nbsp;&nbsp;  Penuh keyakinan namun tidak over acting<br>&nbsp;&nbsp;&nbsp;  Respect<br>&nbsp;&nbsp;&nbsp;  Teamwork yang baik<br><br>4. Kredibel<br><br>Meliputi namun tidak terbatas:<br><br>&nbsp;&nbsp;&nbsp;  Bekerja keras, cerdas dan tuntas<br>&nbsp;&nbsp;&nbsp;  Bersikap efektif dan efisien<br>&nbsp;&nbsp;&nbsp;  Disiplin<br>&nbsp;&nbsp;&nbsp;  Fokus pada goal<br>&nbsp;&nbsp;&nbsp;  Kebersihan<br>&nbsp;&nbsp;&nbsp;  Pantang menyerah<br>&nbsp;&nbsp;&nbsp;  Tanggung jawab<br>&nbsp;&nbsp;&nbsp;  Tidak mengabaikan kualitas<br><h2 style=\"text-align:justify\"><span style=\"font-weight: normal;\"><span style=\"font-size:12.0pt\"><b><span style=\"font-size:12.0pt\">4. Role</span></b></span></span></h2>\r\n\r\n<p style=\"text-align:justify\">Peran utama anggota prakerin adalah sebagai Tim\r\nSupport yang akan membantu tim inti maupun perusahaan, baik secara\r\nteknis maupun non-teknis. Namun apabila anggota prakerin memiliki potensi untuk\r\nmenjadi tim inti, maka mempunyai kemungkinan akan dimasukkan ke dalam tim inti. </p><p style=\"text-align:justify\">Tim Support  Bertanggung jawab\r\nkepada Tim Inti dan Owner\r\n\r\n</p><p style=\"text-align:justify\">Tim Inti  Bertanggung jawab\r\nlangsung kepada Client dan Owner</p><h2 style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><b><span style=\"font-size:12.0pt\">5. Rules</span></b></span></h2>\r\n\r\n<ol type=\"1\" start=\"1\"><ol type=\"1\" start=\"1\"><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>IN</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m