style=\"font-size:12.0pt\">B</span><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">ebas\r\n     nyaman, kecuali ada instruksi khusus.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt\">Komunikatif - </span><span style=\"font-size:12.0pt\">Dengan\r\n     tetap menjaga hak dan kewajiban masing-masing.</span><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"></span></li></ol><h3 style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt;\r\nline-height:115%\">Daily Activity Report</span></strong><strong><span style=\"font-size:12.0pt;line-height:115%;font-weight:normal\">:</span></strong><span style=\"font-size:12.0pt;line-height:115%;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"></span></h3>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l8 level1 lfo5;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Laporan\r\n     pencapaian kemarin serta hambatan</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l8 level1 lfo5;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Laporan\r\n     target hari ini</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l8 level1 lfo5;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Inspeksi\r\n     dari anggota lain (pertanyaan, saran, informasi, dll.)</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l8 level1 lfo5;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Adaptasi\r\n     target hari ini, jika diperlukan penyesuaian setelah diinspeksi</span></li></ul>\r\n\r\n<h2 style=\"text-align:justify\"><strong><span style=\"font-size: 12pt;\">Perizinan:</span></strong><span style=\"font-size:12.0pt\"></span></h2>\r\n\r\n<ol type=\"1\" start=\"1\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l6 level1 lfo6;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Izin\r\n     tidak masuk kantor bukan berarti melalaikan tugas yang sebelumnya telah\r\n     diberikan.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l6 level1 lfo6;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Izin\r\n     harus mengetahui anggota tim dan pembimbing.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l6 level1 lfo6;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Izin\r\n     selambat-lambatnya diajukan H-1 pada jam kerja dan hari kerja dengan\r\n     persetujuan anggota tim (berlaku kelipatan). Lebih dari itu pembimbing\r\n     berhak menolak pengajuan izin.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l6 level1 lfo6;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Izin\r\n     pada hari H (mendadak) hanya berlaku untuk kondisi <i>special</i> seperti orang\r\n     tua sakit parah, meninggal, kendaraan mogok di perjalanan,\r\n     kecelakaan, musibah, dan semacamnya.</span></li></ol><p style=\"text-align: justify; line-height: normal;\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><b>Konsekuensi dalam Prakerin</b><br></span></p>\r\n\r\n<ol type=\"1\" start=\"1\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l2 level1 lfo7;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Tugas\r\n     wajib diselesaikan di awal (<i style=\"mso-bidi-font-style:normal\">weekday</i>).\r\n     Jika tidak selesai, maka peserta prakerin diwajibkan masuk di <i style=\"mso-bidi-font-style:normal\">weekend </i>untuk menyelesaikan\r\n     tugasnya. </span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l2 level1 lfo7;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Jika\r\n     2 minggu sebelum tanggal berakhir prakerin masih belum menuntaskan DoD\r\n     (Syarat Kelulusan Prakerin), maka durasi prakerin akan\r\n     diperpanjang selama 2 minggu, berlaku kelipatan hingga DoD telah\r\n     tuntas.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l2 level1 lfo7;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Jika\r\n     dalam masa Training, peserta prakerin tidak menunjukkan perkembangan yang\r\n     baik, tim Prakerin atau mentor akan inspeksi terkait hambatan atau potensi\r\n     bidang lain. Jika ternyata memang ada potensi bidang lain yang lebih baik,\r\n     maka peserta prakerin akan dipindahkan ke posisi yang lain.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l2 level1 lfo7;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Pelanggaran\r\n     yang bersifat menengah akan diberikan SP 2 dan peserta dikembalikan\r\n     sementara ke sekolah/kampus untuk dilakukan pembinaan (1 minggu).</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l2 level1 lfo7;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Jika\r\n     peserta prakerin melakukan kesalahan teknis, selama masih ada niat baik\r\n     dan tanggung jawab, maka masih bisa ditoleransi. Namun jika peserta prakerin\r\n     melanggar dan atau terlibat dalam pelanggaran norma hukum, perilaku, sopan\r\n     santun atau adab dalam belajar, maka peserta prakerin akan\r\n     diberhentikan dari prakerin (dikeluarkan).</span></li></ol>\r\n\r\n<h2 style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">A</span><span style=\"font-size: 12pt;\">dab dalam belajar:</span></strong><span style=\"font-size:12.0pt\"></span></h2>\r\n\r\n<ol type=\"1\" start=\"1\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-size:12.0pt;font-family:\">Bersungguh-sungguh\r\n     dalam belajar</span></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-size:12.0pt;font-family:\">Bertanggung\r\n     jawab terhadap tugas yang diberikan</span></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-size:12.0pt;font-family:\"><span style=\"font-size:12.0pt;font-family:\">Disiplin</span></span></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-size:12.0pt;font-family:\"><span style=\"font-size:12.0pt;font-family:\">Jujur</span></span></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-size:12.0pt;font-family:\"><span style=\"font-size:12.0pt;font-family:\">Mau berbagi ilmu<br></span></span></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Memiliki\r\n     niat atau tujuan yang baik</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"></span><span style=\"font-size:12.0pt;font-family:\">Memiliki\r\n     persiapan yang terbaik</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"></span><span style=\"font-size:12.0pt;font-family:\">Mencatat\r\n     setiap ilmu yang didapatkan</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l7 level1 lfo8;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\">Sabar</span></li></ol><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><b>Syarat dan Ketentuan Prakerin: </b><span style=\"mso-spacerun:yes\">&nbsp;</span></span></p><b>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Soft Skills</b><br><br>&nbsp;&nbsp;&nbsp; Analytic skills<br>&nbsp;&nbsp; &nbsp;Attitude<br>&nbsp;&nbsp; &nbsp;Collaboration<br>&nbsp;&nbsp; &nbsp;Communication<br>&nbsp;&nbsp; &nbsp;Creativity<br>&nbsp;&nbsp; &nbsp;Decision Making<br>&nbsp;&nbsp; &nbsp;Emotional Intelligence<br>&nbsp;&nbsp; &nbsp;Empathy<br>&nbsp;&nbsp; &nbsp;Flexibility<br>&nbsp;&nbsp; &nbsp;Initiative <br>&nbsp;&nbsp; &nbsp;Leadership<br>&nbsp;&nbsp; &nbsp;Self-Awareness<br>&nbsp;&nbsp; &nbsp;Teamwork<br>&nbsp;&nbsp; &nbsp;Work Ethic<br><br><b>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hard Skills</b><br><br>&nbsp;&nbsp; &nbsp;An industry-specific certification<br>&nbsp;&nbsp; &nbsp;Bookkeeping<br>&nbsp;&nbsp; &nbsp;Coding ability<br>&nbsp;&nbsp; &nbsp;Computer skills<br>&nbsp;&nbsp; &nbsp;Data mining<br>&nbsp;&nbsp; &nbsp;Foreign language skills<br>&nbsp;&nbsp; &nbsp;SEO marketing<br>&nbsp;&nbsp; &nbsp;Typing speed<br><br><b>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Support Device</b><br><br>&nbsp;&nbsp; &nbsp;Mobile Phone<br>&nbsp;&nbsp; &nbsp;Personal Computer/Laptop<h2 style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Tahapan\r\nPemberhentian Prakerin:</span></h2>\r\n\r\n<ol type=\"1\" start=\"1\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l0 level1 lfo9;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Apabila\r\n     telah melanggar peraturan di atas, maka akan mendapatkan teguran\r\n     terlebih dahulu.</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l0 level1 lfo9;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Apabila\r\n     masih mengulangi kesalahan yang sama setelah mendapat teguran, maka akan\r\n     mendapatkan surat peringatan 1 dan 2 .</span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     text-align:justify;line-height:normal;mso-list:l0 level1 lfo9;tab-stops:\r\n     list 36.0pt\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Apabila\r\n     telah mendapat surat peringatan yang terakhir, maka akan\r\n     ada pemberhentian hubungan prakerin dan anggota prakerin\r\n     akan dikembalikan ke sekolah atau kampusnya, jika prakerin wajib dari\r\n     sekolah/kampus.</span></li></ol>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal;mso-outline-level:2\"><b><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:in\"=\"\">6. Definition of Done (DoD) Prakerin</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-fareast-language:in\"=\"\">Ada beberapa syarat seorang prakerin dapat dikatakan\r\n\"SELESAI\" atau lulus prakerin di Red Levl Mediatama:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-fareast-language:in\"=\"\">a. Menyelesaikan minimal 1 (satu) Project<br>b. Selalu mengisi Daily Journal<br>c. Menyiapkan Sertifikat Prakerin (hubungi admin)<br>d. Membuat Slide presentasi journey recap<br>e. Menyelesaikan Laporan kampus/sekolah<br>f. Menyiapkan form Nilai untuk kampus/sekolah untuk diberikan pada mentor</span><br><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-fareast-language:in\"=\"\"><span style=\"font-size:12.0pt;\r\nfont-family:\">g. Mengisi dan menandatangani form pernyataan (hubungi admin)<br></span></span><b><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-fareast-language:in\"=\"\"><br></span><span style=\"font-size:12.0pt\">7.\r\nCongratulations</span></b></p>\r\n\r\n<p style=\"text-align:justify\">Selamat, Anda telah selesai mempelajari sistem prakerin\r\ndi Red levl Mediatama!</p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><br></span></p>', '1633087711', 'internship-standard-operating-procedure');

